import React, { useContext, useState } from 'react';
import { AuthContext } from '../../context/authContext';


const GestionAsignaciones = () => {
  const { setAuth } = useContext(AuthContext);
  const [asignaciones, setAsignaciones] = useState([
    { id: 'A105', detalles: 'Detalles de la asignación A105' },
    { id: 'A106', detalles: 'Detalles de la asignación A106' },
    { id: 'A107', detalles: 'Detalles de la asignación A107' },
  ]);

  const handleLogout = () => {
    setAuth(null);
  };

  const styles = {
    container: {
      fontFamily: 'Arial, sans-serif',
      maxWidth: '800px',
      margin: '0 auto',
      padding: '20px',
    },
    title: {
      backgroundColor: '#ffd700',
      color: 'black',
      padding: '10px',
      textAlign: 'center',
    },
    section: {
      marginBottom: '20px',
      padding: '15px',
      borderRadius: '5px',
    },
    input: {
      width: '100%',
      padding: '5px',
      marginBottom: '10px',
    },
    button: {
      backgroundColor: '#4a5d23',
      color: 'white',
      border: 'none',
      padding: '10px 15px',
      cursor: 'pointer',
      marginRight: '10px',
    },
    textarea: {
      width: '100%',
      padding: '5px',
      marginBottom: '10px',
      minHeight: '100px',
    },
  };

  return (
    
    <div style={styles.container}>
      <h1 style={styles.title}>GESTIÓN DE ASIGNACIONES</h1>

      <div style={{...styles.section, backgroundColor: '#e6f3e6'}}>
        <h2>VER ASIGNACIÓN</h2>
        {asignaciones.map((asignacion) => (
          <div key={asignacion.id}>
            <span>{asignacion.id}</span>
            <button style={styles.button}>Ver + Detalles</button>
          </div>
        ))}
        <textarea style={styles.textarea} placeholder="DETALLE DE LA ASIGNACIÓN" readOnly></textarea>
      </div>

      <div style={{...styles.section, backgroundColor: '#f0f0f0'}}>
        <h2>BUSCAR ASIGNACIÓN</h2>
        <input style={styles.input} type="text" placeholder="ID ASIGNACIÓN" />
        <button style={styles.button}>Buscar</button>
        <textarea style={styles.textarea} placeholder="INFORMACIÓN DE LA ASIGNACIÓN" readOnly></textarea>
      </div>

      <div style={{...styles.section, backgroundColor: '#e6f3e6'}}>
        <h2>CREAR ASIGNACIÓN</h2>
        <input style={styles.input} type="text" placeholder="ID ASIGNACIÓN" />
        <input style={styles.input} type="text" placeholder="RUT CONDUCTOR" />
        <input style={styles.input} type="text" placeholder="RUT PASAJEROS" />
        <button style={styles.button}>Agregar asignación</button>
      </div>

      <div style={{...styles.section, backgroundColor: '#f0f0f0'}}>
        <h2>MODIFICAR ASIGNACIÓN</h2>
        <input style={styles.input} type="text" placeholder="ID ASIGNACIÓN" />
        <input style={styles.input} type="text" placeholder="RUT CONDUCTOR" />
        <input style={styles.input} type="text" placeholder="RUT PASAJEROS" />
        <button style={styles.button}>Actualizar asignación</button>
      </div>

      <div style={{...styles.section, backgroundColor: '#e6f3e6'}}>
        <h2>ELIMINAR ASIGNACIÓN</h2>
        <input style={styles.input} type="text" placeholder="ID ASIGNACIÓN" />
        <textarea style={styles.textarea} placeholder="INFORMACIÓN DE ASIGNACIÓN" readOnly></textarea>
        <button style={styles.button}>Buscar</button>
        <button style={styles.button}>Eliminar asignación</button>
      </div>

      <button style={{...styles.button, display: 'block', margin: '20px auto'}} onClick={handleLogout}>
        VOLVER AL PANEL
      </button>
    </div>
   
  );
};

export default GestionAsignaciones;
